import { useState } from 'react';

import "./Body.css";

export default function Body() {
  const RainbowText = () => {
    const [isHovered, setIsHovered] = useState(false);

    const handleMouseEnter = () => {
      setIsHovered(true);
    };

    const handleMouseLeave = () => {
      setIsHovered(false);
    };
    return (
      <body>
        <div class="name-description">
          <h1
            className={`name ${isHovered ? "rainbow-text" : ""}`}
            onMouseEnter={handleMouseEnter}
            onMouseLeave={handleMouseLeave}
          >
            ¡Hola! Gracias por entrar, soy Rodrigo VdeV
          </h1>
          <p class="description">
            Diseñador UX/UI y desarrollador web front-end
          </p>
        </div>
      </body>
    );
  };
}
